import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


function Footer() {
  return (
    <footer className="py-16 flex flex-col text-grey-darker text-sm text-gray-500 bg-gray-900 items-center">
      <p>Designed and built by Katherine Reyes. Â©2019 All rights reserved.</p>
      <ul class="flex mt-4">
        <li className="text-gray-400 transition hover:text-white anime-floatUp"><a href="https://www.instagram.com/lildotstudio/" class="mx-2"><FontAwesomeIcon icon={['fab', 'instagram']} /></a></li>
        <li className="text-gray-400 transition hover:text-white anime-floatUp"><a href="https://www.instagram.com/roamalong/" class="mx-2"><FontAwesomeIcon icon={['fab', 'instagram']} /></a></li>
        <li className="transition anime-gradientText-dark anime-floatUp"><a href="https://dribbble.com/klreyes" class="mx-2"><FontAwesomeIcon icon={['fab', 'dribbble']} /></a></li>
        <li className="text-gray-400 transition hover:text-white anime-floatUp"><a href="mailto:klong128@gmail.com" class="mx-2"><FontAwesomeIcon icon={['far', 'envelope']} /></a></li>
      </ul>
    </footer>
  );
}

export default Footer;
